import React, {Component} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './components/Home';
import SinglePost from './components/SinglePost';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Home path="/"/>
        <SinglePost path="/post/:id"/>
      </Router>
    </div>
  );
}

export default App;
